import React from "react";

import { galleryPanfu } from "../helpers/data";

export default function Gallery() {
  return (
    <div>
      <h1>This is gallery page</h1>
      {galleryPanfu.map((imag, i) => {
          return (<div key={i}>
              <img src={imag.image} />
          </div>)
      })}
    </div>
  );
}
